import React from 'react';

type AccordionPropsTitle = {
  titleValue: string;
}

export function Accordion(props: AccordionPropsTitle) {
  return (
    <>
      <AccordionTitle titleValue={props.titleValue} collapsed={props.collapsed}/>
      {
        !props.collapsed &&  <AccordionBody/>
      }
    </>
  );
};

export function AccordionTitle(props: AccordionPropsTitle) {
  return (
    <button>
      <h3>
        {props.titleValue}
      </h3>
    </button>

  );
};

export function AccordionBody() {
  return (
    <div>
      <ul>
        <li></li>
        <li></li>
        <li></li>
      </ul>
    </div>
  );
};
